import "bootstrap/dist/css/bootstrap.min.css";
const Header = ({ selectedTeam, teamMemberCount }) => {
  return (
    <header>
      <h1 className="">Team Member Allocation</h1>;
      <h3>
        {selectedTeam} has {teamMemberCount} Members
      </h3>
      ;
    </header>
  );
};

export default Header;
